        public static class OtherListBean implements Parcelable{
            /**
             * Id : 00000000-0000-0000-0000-000000000000
             * name : 合同名
             * value : 工程项目合同
             * pId : 00000000-0000-0000-0000-000000000000
             */

            private String Id;
            private String name;
            private String value;
            private String pId;

            protected OtherListBean(Parcel in) {
                Id = in.readString();
                name = in.readString();
                value = in.readString();
                pId = in.readString();
            }

            @Override
            public String toString() {
                return "OtherListBean{" +
                        "Id='" + Id + '\'' +
                        ", name='" + name + '\'' +
                        ", value='" + value + '\'' +
                        ", pId='" + pId + '\'' +
                        '}';
            }

            public static final Creator<OtherListBean> CREATOR = new Creator<OtherListBean>() {
                @Override
                public OtherListBean createFromParcel(Parcel in) {
                    return new OtherListBean(in);
                }

                @Override
                public OtherListBean[] newArray(int size) {
                    return new OtherListBean[size];
                }
            };

            public String getId() {
                return Id;
            }

            public void setId(String Id) {
                this.Id = Id;
            }

            public String getName() {
                return name;
            }

            public void setName(String name) {
                this.name = name;
            }

            public String getValue() {
                return value;
            }

            public void setValue(String value) {
                this.value = value;
            }

            public String getPId() {
                return pId;
            }

            public void setPId(String pId) {
                this.pId = pId;
            }

            @Override
            public int describeContents() {
                return 0;
            }

            @Override
            public void writeToParcel(Parcel dest, int flags) {
                dest.writeString(Id);
                dest.writeString(name);
                dest.writeString(value);
                dest.writeString(pId);
            }
        }
